import React from "react";
import "./AboutMe.css";

const AboutMe = () => {
  return (
    <div className="aboutMeDiv">
      <h1 className="color">Find out about my extraordinary life</h1>
      <p className="paragraphAboutMe">
        So much has happened to pave the way for this art shop. I am passionate
        about providing more support for mental health inWales, and all proceeds
        will go towards funding a place of safety for young people in and around
        Swansea. Find out more about the 'Have a Heart Foundation'.
      </p>
      <a className="aboutMeButton" href="/AboutMe">
        Find out about Jo
      </a>
    </div>
  );
};

export default AboutMe;
